package codeReader;

public class Pair {
	private int start;
	private int end;
	
	public Pair(int s, int e) {
		// TODO Auto-generated constructor stub
		setStart(s);
		setEnd(e);
	}
	
	public int getStart() {
		return start;
	}
	
	public void setStart(int start) {
		this.start = start;
	}
	
	public int getEnd() {
		return end;
	}
	
	public void setEnd(int end) {
		this.end = end;
	}
}
